(1, '<p><br></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;\"><span style=\"font-weight: bolder; font-family: Arial, sans-serif; font-size: 14px; white-space: pre;\">Layanan Pelanggan</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;\"><span style=\"font-family: Arial, sans-serif; font-size: 14px; white-space: pre;\">Saran, kritik, dan keluhan dapat disampaikan </span><span style=\"font-family: Arial, sans-serif; font-size: 14px; white-space: pre;\">melalui e-mail atau telepon berikut:</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;\">E-mail:&nbsp;<span style=\"font-family: Arial, sans-serif; font-size: 14px; white-space: pre;\">gekacustomerservices@gmail.com</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;\">Whatsapp: 087827112777</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;\"><span style=\"font-family: Arial, sans-serif; font-size: 14px; white-space: pre;\"><br></span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;\"><span style=\"font-family: Arial, sans-serif; font-size: 14px; white-space: pre; font-weight: bold;\">Layanan Pengaduan</span><span style=\"font-family: Arial, sans-serif; font-size: 14px; white-space: pre;\">\r\nUntuk pengaduan yang ingin dirahasiakan pelapornya, dapat disampaikan melalui e-mail </span><span style=\"font-family: Arial, sans-serif; font-size: 14px; white-space: pre;\">atau telepon </span><span style=\"font-family: Arial, sans-serif; font-size: 14px; white-space: pre;\">berikut:</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;\"><span style=\"font-family: Arial, sans-serif; font-size: 14px; white-space: pre;\">E-mail: gekacustomerservices@gmail.com</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;\"><span style=\"font-weight: bolder; font-family: Arial, sans-serif; font-size: 14px; white-space: pre;\"></span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;\"><span style=\"font-family: Arial, sans-serif; font-size: 14px; white-space: pre;\">Whatsapp: 087781126131</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;\"><br></p><p style=\"\"><span style=\"font-size: 1rem;\">Kami berkomitmen memberikan layanan terbaik untuk Anda,&nbsp;menyediakan produk dan layanan terbaik yang Anda butuhkan. Apabila untuk alasan tertentu Anda merasa tidak puas dengan pelayanan kami dapat menyampaikan kritik dan saran.</span></p><p style=\"color: rgb(0, 0, 0); font-size: var(--system-14-font-size); font-weight: var(--font-weight-system-regular); margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;\"><br></p>\r\n');
