(33, 'section_contact', '{\"judul\":\"Kontak\",\"deskripsi\":\"Hubungi kami \",\"text\":\"<h1 class=\\\"_aacl _aaco _aacu _aacx _aad6 _aade\\\" style=\\\"color: rgb(0, 0, 0); font-size: var(--system-14-font-size); font-weight: var(--font-weight-system-regular); margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-family: -apple-system, BlinkMacSystemFont, \\\" segoe=\\\"\\\" ui\\\",=\\\"\\\" roboto,=\\\"\\\" helvetica,=\\\"\\\" arial,=\\\"\\\" sans-serif;=\\\"\\\" line-height:=\\\"\\\" var(--system-14-line-height);\\\"=\\\"\\\"><p style=\\\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, \\\" segoe=\\\"\\\" ui\\\",=\\\"\\\" roboto,=\\\"\\\" \\\"helvetica=\\\"\\\" neue\\\",=\\\"\\\" arial,=\\\"\\\" \\\"noto=\\\"\\\" sans\\\",=\\\"\\\" sans-serif,=\\\"\\\" \\\"apple=\\\"\\\" color=\\\"\\\" emoji\\\",=\\\"\\\" \\\"segoe=\\\"\\\" ui=\\\"\\\" symbol\\\",=\\\"\\\" emoji\\\";=\\\"\\\" padding:=\\\"\\\" 0px;\\\"=\\\"\\\"><span style=\\\"font-weight: bold; font-family: inherit; font-size: var(--system-14-font-size);\\\">PT GADAI EMAS KRESNO ANDALAN<\\/span><\\/p><p style=\\\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, \\\" segoe=\\\"\\\" ui\\\",=\\\"\\\" roboto,=\\\"\\\" \\\"helvetica=\\\"\\\" neue\\\",=\\\"\\\" arial,=\\\"\\\" \\\"noto=\\\"\\\" sans\\\",=\\\"\\\" sans-serif,=\\\"\\\" \\\"apple=\\\"\\\" color=\\\"\\\" emoji\\\",=\\\"\\\" \\\"segoe=\\\"\\\" ui=\\\"\\\" symbol\\\",=\\\"\\\" emoji\\\";=\\\"\\\" padding:=\\\"\\\" 0px;\\\"=\\\"\\\">CEPAT - TEPAT - HEMAT<br>Gadai Emas Terpercaya<br>di Kota Tegal<br><br><\\/p><p style=\\\"text-align: justify; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(33, 37, 41);\\\">Kami berkomitmen memberikan layanan terbaik untuk Anda,&nbsp;menyediakan produk dan layanan terbaik yang Anda butuhkan, Apabila untuk alasan tertentu Anda m