(35, 'section_faq', '{\"judul\":\"FAQs\",\"deskripsi\":\"Menjawab Pertanyaan Umum\",\"tanya_1\":\"bagaimana sih cara gadai emas di PT GEKA\",\"jawab_1\":\"<br>1. Ambil no antrian di Loket GEKA<\\/br>\\r\\n<br>2. Menyerahkan no antrian ke Pegawai GEKA<\\/br> \\r\\n<br>3. Menunggu no antrian di panggil<\\/br>\\r\\n<br>4. Setelah di panggil akan di tanya keperluan datang ke GEKA<\\/br>\\r\\n<br>5. Untuk nasabah baru GEKA terlebih dahulu mengisi pengkinian data nasabah<\\/br>\",\"tanya_2\":\"Apa saja syaratnya\",\"jawab_2\":\"<br>1. Ktp<\\/br>\\r\\n<br>2. Member Kresno<\\/br>\\r\\n<br>3. Surat Emas Sesuai Nama Ktp<\\/br>\\r\\n<br>4.  jika nama yang tertera pada surat emas tidak sesuai dengan nama nasabah, maka wajib menandatangani surat pernyataan yang di keluarkan oleh PT GEKA bermaterai dan wajib membawa KTP atas nama yang tertera pada surat emas.<\\/br>\\r\\n<br>5. Jika emas yang akan digadai tidak beli di toko emas kresno, maka wajib menandatangani surat pernyataan kepemilikan emas, yang dikeluarkan oleh PT GEKA bermaterai.<\\/br>\",\"tanya_3\":\"Apabila Jatuh Tempo Kredit Saat Kantor PT GEKA Libur, Apakah Kena Denda\",\"jawab_3\":\"Terkena Denda, Karena bunga berjalan \\r\\n\",\"tanya_4\":\"Berapa Persen Besar Suku Bunga Saat Menggadaikan di PT GEKA\",\"jawab_4\":\"<br>SUKU BUNGA <\\/br>\\r\\n\\r\\n<br>REGULER\\r\\n<br>s.d 5 juta perhari 0.116%<\\/br>\\r\\n5 juta s.d 25 juta perhari 0.1%<\\/br>\\r\\n25 juta ke atas perhari 0.083%<\\/br>\\r\\nBiaya ADMIN Rp. 5.000<\\/br>\\r\\n\\r\\n<br>FLEXI<\\/br>\\r\\ns.d 5 juta perhari 0.133%<\\/br>\\r\\n5 juta s.d 25 juta perhari 0.1%<\\/br>\\r\\n25 juta s.d 100 juta perhari 0.083%<\\/br>\\r\\n100 juta ke atas perhari 0.066%<\\/br>\",\"tanya_5\":\"Berapa Besar Total Pelunasan Barang yang Kita Gadai\",\"jawab_5\":\"Besar pelunasan gadai di hitung dari berapa lama gadai di tambah pokok pinjaman \"}'),
