INSERT INTO `tbl_nicepage_portfolio` (`id_portfolio`, `nama_project`, `nama_client`, `url`, `deskripsi`, `image`) VALUES
(1, 'Undian 40th Ulang Tahun Kresno Gold & Diamond', '', 'https://youtu.be/frxVq_o5b2I?si=f-eYNiDF-M6XpFB-', 'Sebanyak 6 unit sepeda motor Yamaha Fazio menjadi hadiah undian pada ulang tahun Toko Emas Kresno yang ke 40 Tahun. Tidak hanya sepeda motor, puluhan hadiah menarik lainnya yang memeriahkan acara ulang tahun 40th Toko Emas Kresno', 'DSCF6475.png'),
(5, 'Komisaris dan Direktur PT GEKA hadiri 40th Kresno Gold & Diamond', '', '', 'Komisaris dan Direktur PT GEKA menghadiri acara ulang tahun Kresno Gold & Diamond yang ke 40 tahun.', 'DSCF6652.png'),
(8, 'Kemeriahan Pameran Kresno Vaganza semakin lengkap dengan kehadiran PT GEKA!', '', '', '✨ Kilau emas menantimu di Pameran Kresno Vaganza 2024! ✨ Datang dan kunjungi booth GEKA untuk penawaran menarik dan proses gadai yang mudah. Jangan lewatkan kesempatan untuk mendapatkan dana tunai instan dan konsultasi Gratis!', 'gk1.jpg');
