INSERT INTO `tbl_nicepage_testimoni` (`id_testimoni`, `nama`, `profesi`, `photo`, `testimoni`) VALUES
(17, 'Sely', 'Pedagang', 'testimoni_3.jpg', 'Gadai Emas Kresno Andalan telah menjadi solusi bagi saya dalam situasi keuangan darurat. Layanan yang cepat, transparan, dan terpercaya. Saya sangat berterima kasih atas bantuan mereka dalam saat-saat sulit ini.'),
(19, 'Lusi', 'Designer', 'testimoni_6.jpg', 'Tempat gadai emas terpercaya! Saya senang dengan nilai penilaian yang baik dan suku bunga yang adil. Semua prosesnya berjalan lancar, dan saya bisa mendapatkan uang tunai yang saya butuhkan dengan cepat. Terima kasih Gadai Emas Kresno Andalan!'),
(21, 'Aditya', 'Pembeli Emas', 'testimoni_2.jpg', 'Pengalaman gadai emas pertama saya sangat menyenangkan berkat Gadai Emas Kresno Andalan. Mereka memberikan penjelasan yang jelas tentang prosesnya, dan saya merasa nyaman mengajukan gadai emas di sini.');
